Na tebya upovayu/I Hope for You/All My Hope Is In You/In Thee I Trust (1992)

Year: 1992
Genre: Drama
Country:Russia
Duration: 1:24:17

Director:Yelena Tsyplakova

Cast: Eugene Dobrovol'skaya, Irina Rozanov, Sergei Batalov, Galina Demin, Natalia Fedortseva, Valery Filatov, Natalia Fisson, Vladimir Ilyin, Alexander Kashperov, Galina Makarova

Description:
An emotionally distraught young woman takes a job at an orphanage housing children roughly three to seven years of age. Might she there find a solution to the cause of her problems? A decently done slice-of-life drama which includes vignettes about a spanking-happy caretaker, bed-wetting and more.
